#preloader {
  position: absolute;
  width: 100%;
  margin: 0 auto;
  height: 100%;
  z-index: 1;
  display: block;
  opacity: 1;
}

.loadercircle {
  width: 5em;
  height: 5em;
  margin: 0px auto;
  border: 5px solid #E6F1D6;
  border-top: 6px solid #FFACAC;
  margin-top: 25%;
  border-radius: 50%;
  animation: spin 1s ease-in infinite;
}

@keyframes spin {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
}
#pagecontent {
  position: relative;
  bottom: 0px;
  display: block;
  opacity: 1;
  animation: showContent 2s ease forwards;
  z-index: 20;
}

@keyframes showContent {
  0% {
    display: none;
    opacity: 0;
  }
  50% {
    display: block;
    opacity: 0.2;
  }
  70% {
    display: block;
    opacity: 0.5;
  }
  100% {
    display: block;
    opacity: 1;
  }
}
body {
  height: 1000px;
  background-color: #323C44;
  -ms-overflow-style: none;
  /* IE 11 */
  scrollbar-width: none;
}

@font-face {
  font-family: "Arvo";
  font-display: auto;
  src: local("Arvo"), url(https://fonts.gstatic.com/s/arvo/v9/rC7kKhY-eUDY-ucISTIf5PesZW2xOQ-xsNqO47m55DA.woff2) format("woff2");
}
nav {
  box-shadow: 0px 1px 10px rgba(0, 0, 0, 0.2);
}
nav a {
  color: white;
  margin-left: 20px;
}
nav a:hover {
  color: #E6F1D6 !important;
}
nav .navbar-text {
  font-size: 0.8em;
}
nav .btn {
  background-color: white;
  border-radius: 10px;
  padding-left: 5px;
  padding-right: 5px;
  color: #323C44;
  text-transform: uppercase;
}
nav span#sidenav-trigger-dash {
  background-color: transparent;
  color: white;
}

.nav_slide_off {
  background-color: #323C44;
  position: absolute;
  left: -1000px;
  z-index: 1300;
  animation: remove-nav 1s ease-out forwards;
  opacity: 0;
  display: none;
}
.nav_slide_off li:first-child {
  margin-top: 20px;
}
.nav_slide_off li {
  list-style-type: none;
  width: 100%;
  margin-left: 10px;
  margin-top: 5px;
}
.nav_slide_off li a {
  display: block;
  color: white;
}

@keyframes remove-nav {
  0% {
    left: 0px;
  }
  25% {
    left: -200px;
    opacity: 0.7;
  }
  50% {
    left: -400px;
    opacity: 0.4;
  }
  75% {
    left: -700px;
    opacity: 0.2;
  }
  100% {
    left: -1000px;
  }
}
@keyframes slide {
  0% {
    left: -600px;
    opacity: 0.1;
    display: block;
  }
  25% {
    left: -400px;
    opacity: 0.1;
    display: block;
  }
  50% {
    left: -200px;
    opacity: 0.4;
    display: block;
  }
  75% {
    left: 5px;
    opacity: 0.5;
    display: block;
  }
  100% {
    left: 0px;
    opacity: 1;
    display: block;
  }
}
.nav_slide_on {
  left: 0px;
  width: 100%;
  position: fixed;
  display: block;
  opacity: 1;
  animation: slide 300ms ease-in-out forwards;
  z-index: 1200;
  height: 100%;
