sources.sass\\_preloader.scss:
#preloader{
	position: absolute;
	width: 100%;
	margin: 0 auto;
	height: 100%;
	z-index: 1;
	display: block;
	opacity: 1;
}

.loadercircle {
	width: 5em;
	height: 5em;
	margin: 0px auto;
	border: 5px solid $hoverColor;
	border-top: 6px solid #FFACAC;
	margin-top: 25%;
	border-radius: 50%;
	animation: spin 1s ease-in infinite;
}

@keyframes spin {
	from{transform: rotate(0deg);}
	to{transform: rotate(360deg);}
}

#pagecontent{
	position: relative;
	bottom: 0px;
	display: block;
	opacity: 1;
	animation: showContent 2s ease forwards;
	z-index: 20;
}

@keyframes showContent{
	0%{display: none; opacity: 0}
	50%{display: block; opacity: 0.2}
	70%{display: block; opacity: 0.5}
	100%{display: block; opacity: 1}
}

sources.sass\\main.scss:
$body_color: teal;

$primaryColor: #323C44; // Main overall color
$highlightColor: red;	// Highlight color
$textOnHighlight: white; // Text on the highlighted color
$hoverColor: #E6F1D6;


@import 'paymentfont';
@import 'cryptofont';
@import 'preloader';


body{
	height: 1000px;
	background-color: $primaryColor;
	-ms-overflow-style: none; /* IE 11 */
	scrollbar-width: none;
}

@font-face {
  font-family: 'Arvo';
  font-display: auto;
  src: local('Arvo'), url(https://fonts.gstatic.com/s/arvo/v9/rC7kKhY-eUDY-ucISTIf5PesZW2xOQ-xsNqO47m55DA.woff2) format('woff2');
}

nav{
	box-shadow: 0px 1px 10px rgba(0,0,0, 0.2);

	a{
		color: $textOnHighlight;
		margin-left: 20px;
	}
	a:hover{
		color: $hoverColor !important;
	}

	.navbar-text{
		font-size: 0.8em
	}

	.btn{
		background-color: $textOnHighlight;
		border-radius: 10px;
		padding-left: 5px;
		padding-right: 5px;
		color: $primaryColor ;
		text-transform: uppercase;
	}

	span#sidenav-trigger-dash{
		background-color: transparent;
		color: $textOnHighlight;
	}
}


.nav_slide_off{
	background-color: $primaryColor;
	position: absolute;
	left: -1000px;
	z-index: 1300;
	animation: remove-nav 1s ease-out forwards;
	opacity: 0;
	display: none;

	li:first-child{
		margin-top: 20px;
	}

	li{
		list-style-type: none;
		width: 100%;
		margin-left: 10px;
		margin-top: 5px;

		a{
			display: block;
			color: $textOnHighlight;
		}
	} 
}

@keyframes remove-nav {
  0%   {left: 0px;}
  25%  {left: -200px; opacity: 0.7;}
  50%  {left: -400px; opacity: 0.4;}
  75% {left: -700px; opacity: 0.2;}
  100% {left: -1000px;}
}

@keyframes slide {
  0%   {left: -600px; opacity: 0.1; display: block;}
  25%  {left: -400px; opacity: 0.1; display: block;}
  50%  {left: -200px; opacity: 0.4; display: block;}
  75% {left: 5px; opacity: 0.5; display: block;}
  100% {left: 0px; opacity: 1;display: block;}
}

.nav_slide_on{
	left: 0px;
	width: 100%;
	position: fixed;
	display: block; 
	opacity: 1; 
	animation: slide 300ms ease-in-out forwards;
	z-index: 1200;
	height: 100%;
	background-color: $primaryColor;

	li:first-child{
		margin-top: 20px;
	}

	li{
		list-style-type: none;
		width: 100%;
		margin-left: 10px;
		margin-top: 5px;

		a{
			display: block;
			color: $textOnHighlight;
		}
	} 
}

#sidenav-trigger{
	border: 2px solid gray;
	padding: 10px;
	color: $textOnHighlight;
	cursor: pointer;
}

#sidenav-trigger:hover{
	transform: scale(1.2,1.2);
}

#hide-usernav{
	position: relative;
	left: 200px;
	transform: scale(0,0);
	display: none;
}

.header_container{
	min-height: 40em;
	background-color: $primaryColor;
	background-image: url('/img/grid.png');
	background-repeat: repeat-x repeat-y;
	background-size: contain;
	width: 100%;
	z-index: 3;
}

.header_container_bck{
	min-height: 60em;
	background-color: $primaryColor;
	background-image: url('/img/grid.png');
	background-repeat: repeat-x repeat-y;
	background-size: contain;
	width: 100%;
	z-index: 3;
}

.header_content_bck{
	min-height: 40em;
	color: $textOnHighlight;
	z-index: 4;
	padding-top: 5em;
	margin-bottom: -5em;

	label{
		font-size: 1em;
	}

	input[type='text'], input[type='password']{
		height: 3em;
		background-color: $textOnHighlight;
	}

}

.header_content{
	min-height: 30em;
	color: $textOnHighlight;
	z-index: 4;
	padding-top: 30px;

	.jumbo_text_box{
		position: relative;
		top: 70px;

		.jumbo_text{
			font-size: 4em;
			font-weight: 800;
		}

		.jumbo_sub{
			font-size:2em;
			font-weight: 200;
			margin-top: -70px;
		}

		a{
			margin-right: 20px;
			margin-top: 10px;
			width: 15em;
			border: 0px solid transparent;
			border-radius: 40px;
			text-transform: capitalize;
		}

		a.create{
			background-color: transparent;
			color: $highlightColor;
			border: 2px solid $textOnHighlight;
		}
	}

	#top_form{

		margin-top: 4em;

		select, option{
			background-color: $highlightColor;
			height: 3em;
			border: 1px solid transparent;
			color: $textOnHighlight;
		}

		.small{
			font-size: 0.8em;
			color: lightgray;
		}

		.redInput{
			background-color: $highlightColor;
			border: 1px solid transparent;
			width: 100%;
			line-height: 2em;
			border-radius: 3px;
			padding-left: 0.7em;
		}
		input{
			height: 3em;
		}
		 .btn{
		 	margin-left: 15px;
		 	border-radius: 30px;
		 	width: 120px;
		 }
	}
}

// About Section

.about{
	min-height: 70em;
	background-color: $textOnHighlight;
	background-image: url('/img/grid.png');
	background-repeat: repeat-x repeat-y;
	background-size: contain;
	width: 100%;
	margin-top: -30px;
	padding-bottom: 100px;
	z-index: 1;

	.line{
		width: 60px;
		border: 3px solid $highlightColor;
		margin-top: 80px;
		margin-bottom: 10px;
	}

	p{
		font-size: 1.2em;
		color: #2A1E1E;
	}

	.box{
		width: 100%;
		margin-bottom: 10px;
		background-color: $textOnHighlight;
		border-radius: 10px;
		height: auto;
		text-align: center;
		padding: 20px;
		overflow: hidden;

		img{
			width: 80px;
			height: 50px;
			display: block;
			margin-left: auto;
			margin-right: auto;
		}

		.head_text{
			display: block;
			margin: 5px;
			font-weight: 800;
			font-size: 1.3em;
		}

	}
}

.about_content{
	min-height: 30em;

	.escrow{
		padding-top: 70px;
	}

	h1 {
		font-size: 3rem;
	}

}

.how_it_works{

	.line{
		width: 60px;
		border: 3px solid $highlightColor;
		margin-top: 80px;
		margin-bottom: 10px;
	}

	h2{
		font-size: 3rem;
	}

}

.ad{
	width: 100%;
	height: 40em;
	background-color: $primaryColor;
	color: $textOnHighlight;

	h3{
		font-weight: 800;
		margin-top: 150px;
	}

	p{
		font-size: 2em;
	}

	.app{
		width: 150px;
		margin-right: 10px;
	}
	.phone_container{
		position: relative;
		height: 47em;
		padding: 0px;
		margin-top: -7em;

		img{
			position: absolute;
			bottom: 0px;
			right: 0px;
			height: 90%;
			width: 45em;
			transform: rotate(7deg);	
		}
	}
}

.map{
	width: 100%;
	height: 50em;
	color: $textOnHighlight;
	z-index: 3;
	position: relative;

	.wrapper{
		height: 200px;
		width: 100%;
		overflow: clip;
		overflow-y: hidden;
	}

	.scrollcontent{
		height: 220px;
		width: 100%;		
		overflow-x: auto;
		overflow-y: hidden;
		display: flex;
		flex-wrap: nowrap;
	}

	.trade_box{
		width: 300px;
		height: 300px;
		background-color: rgba(0,0,0, 0.2);
		padding-top: 20px;
		padding-left: 10px;
		padding-right: 10px;
		padding-bottom: 10px;
	}

	#map{
		margin-top: 3em;
	}

	p{
		padding-left:10%;
	}

	ul{
		list-style-type: none;
	}

	button{
		margin-left: 10%;
		width: 60%;
	}
}

footer{
	width: 100%;
	height: auto;
	padding-bottom: 20px;
	background-color: $primaryColor;

	.footer{
		padding-top: 100px;
		font-size: 1em;
		color: $textOnHighlight;

		ul{
			list-style-type: none;
		}

		li{
			margin-top: 20px;

			a{
				color: $textOnHighlight;
			}
		}


		.social_icons{
			position: relative;
			height: 17em;
			#social{
				position: absolute;
				bottom: 0px;
				right: 0px;

				span{
					margin-right:20px;
					margin-bottom:20px;
					float: left;
					width:15px; 
					height: 15px;
					color: $textOnHighlight;
				}
			}
		}
	}
}

#dashrow{
	display: flex;
	flex-direction: row;
	flex-wrap: wrap;
}

.dashbox{
	width: 100%;
	min-height: 100px;
	background-color: rgba(0,0,0, 0.2);
	z-index: 500;
}




// .................... CUSTOM MEDIA QUARIES .......................

//..................... Small Screen Issues ....................

@media screen and (min-width: 100px) and (max-width: 768px){
	.hide-nav{display: none !important}

	.header_content{
		#top_form{
			margin-top: 8em;
		}
	}

	nav{
		#sidenav-trigger{
			background-color: transparent;
			color: $textOnHighlight;
			border: 0px solid transparent;
		}
	}

}

@media (min-width: 570px) and (max-width: 767px){
	.container{
		max-width: 90% !important;
		padding-right: 1em;
    	padding-left: 1em;
	}
	.ad{
		.phone_container{
			margin-top: 1em !important;
		}
	}
}

@media (max-width: 600px){
	.header_container{
		min-height: 65em;
	}
	.header_content{
		padding-top: 0px;
		margin-top: 0px;
		min-height: 65em;
	}

	.jumbo_text_box{
		top: 40px !important;
	}

	button{
		width: 90%;
		text-transform: uppercase;
	}

	.row .col.s12{
		margin-left: 0px !important;
		padding-left: 0px; 
	}
	.ad{
		height: auto !important;
		padding-bottom: 0em;
		padding-top: 5em;

		.row{
			margin-bottom: 0px ;
		}

		.phone_container{
			height: 30em;
			position: relative;
			padding: 0px;
			margin-top: 1em;

			img{
				position: absolute;
				bottom: 0px;
				right: 0px;
				height: 30em;
				width: 100%;
				transform: rotate(0deg);
			}
		}

		h3{
			font-weight: 800;
			margin-top: 10px;
		}

		p{
			font-size: 1.5em;
		}

	}

	.map{
		height: auto !important;
		padding-bottom: 30px;

		.trade_box{
			height: auto !important;
			margin-bottom: 10px; 
		}

		.row{
			margin-bottom: 30px;
		}

		#map{
			img{
				width: 90% !important;
				padding-left: 20%;
			}
		}

		p{
			padding-left:0%;
		}

		button{
			margin-left: 20%;
		}
	}

	footer{
		.social_icons{
			position: relative;
			height: 5em !important;
			#social{
				position: relative !important;
				align-content: center !important;

				span{
					margin-right:20px;
					margin-bottom:20px;
					float: left;
					width:15px; 
					height: 15px;
					color: $textOnHighlight;
				}
			}
		}
	}


}

@media (min-width: 401px) and (max-width: 500px){
	.ad{
		.phone_container{
			height: 30em !important;
			img{
				width: 100%;
			}
		}
	}
}

@media (max-width: 400px){
	.header_container{
		min-height: 80em;
	}
	.header_content{
		min-height: 70em;
	}

	.ad{

		.phone_container{
			height: 20em;

			img{
				height: 20em;
				width: 100%;
			}
		}
	}

}

@media (max-width: 275px){
	.header_container{
		min-height: 100em;
	}
	.header_content{
		min-height: 70em;
	}

}

@media (min-width: 100px) and (max-width: 670px){
	#hide-on-small-screen{
		display: none !important;
	}
	#show-on-small-screen{
		display: block !important;
	}
}


//..................... Medium Screen issues ..............


@media (min-width: 601px) and (max-width: 992px) {
	// Move logo to the left on medium screen size 

 	.map{

		.trade_box{
			height: auto !important;
			margin-bottom: 10px;
		}

		#map{
			//height: 100%;
			position: relative;
			height: 10em;
			margin-top: 4em;

			img{
				height: 100%;
				position: absolute;
				bottom: 0px;
			}
		}
	}

}

@media (min-width: 601px) and (max-width: 861px){

	.jumbo_text{
		font-size: 3em !important;
		font-weight: 600 !important;
	}

	.jumbo_sub{
		font-size:1.7em !important;
		font-weight: 200;
		margin-top: -70px;
	}

	.map{
		height: auto !important;
		padding-bottom: 30px;

		.trade_box{
			height: auto !important;
			margin-bottom: 10px; 
		}
	}


	.about{
		.box{
			height: 370px !important;
		}
	}

	// Increase the ad box hieght and phone image adjust
	.ad{
		height: auto;


		h3{
			margin-top: 50px;
			font-size: 2.5em;
		}

		p{
			font-size: 1.2em;
		}
		.phone_container{
			height: 28em;
			bottom: -3em;
			margin-top: -4em;

			img{
				height: 100%;
				width: 25em !important;
				//transform: rotate(10deg);	
			}
		}
	}
}

@media (min-width: 862px) and (max-width: 991px){

	.jumbo_text_box{
		position: relative;
		top: 70px;

		.jumbo_text{
			font-size: 4em;
			font-weight: 800;
			line-height: 1em
		}

		.jumbo_sub{
			font-size:2em;
			font-weight: 200;
			margin-top: -70px;
		}
	}

	.redInput{
		font-size: 0.8em;
		line-height: 2em;
	}


	.ad{
		height: 30em;

		h3{
			margin-top: 60px;
		}

		.phone_container{
			height: 32em;
			margin-top: -2em;

			img{
				height: 100%;
				width: 30em !important;	
			}
		}
	}
}

// Handle text break for the top form YOU PAY and TO BUY section

@media (min-width: 768px) and (max-width: 888px){
	.redInput{
		font-size: 0.7em;
		line-height: 2em;
	}
}


// ..................... Larg Screen Issues ................


@media (min-width: 855px) and (max-width: 1100px){
	// Hide the nav text on the top on screen between 925px and 1100px

	.map{
		height: auto !important;
		padding-bottom: 50px;
	}
}

@media (min-width: 992px) and (max-width: 1110px){

	.container{
		width: 90% !important;
	}
	.phone_container{

		img{
			height: 100%;
			width: 40em !important;	
		}
	}
}

@media (min-width: 769px) and (max-width: 1023px){
	.container{
		width: 90% !important;
	}
	.navbar-nav {
	    display: -ms-flexbox;
	    display: flex;
	    -ms-flex-direction: row;
	    flex-direction: row;
	    padding-left: 0;
	    margin-bottom: 0;
	    list-style: none;
	}

	.nav-link {
	    padding-right: .5rem;
	    padding-left: .5rem;
	    margin-left: 10px;
	    margin-left: 10px;
	}

	.nav-link:last-child{
		margin-right: 0px;
	}
}
